import styled from "styled-components";

export const ContainerTitleData = styled.section`
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    text-align: center;
    padding: 3rem 1rem 2rem 1rem;
    color: rgb(90, 90, 90);
    h1{
       text-transform: uppercase;
        font-size: 2rem;
        margin-bottom: 1rem;
    }
    h2{
        font-weight: 500;
    }
`
